import React, { Component } from 'react';

export default class Square extends Component {
  returnId = () => {
    alert(this.props.index)
  }
  render() {
    let { square, key } = this.props
    return(
      <>
        <div id="square">
          { square }
          <button onClick={ this.returnId }>click</button>
        </div>
      </>
    )
  }
}
